import './App.css';
import React from 'react'
import Nav from './components/nav/Nav.tsx';
import { BrowserRouter, Route ,Routes} from 'react-router-dom';
import PlanPage from './components/planPage/PlanPage.tsx';
import TablePage from './components/tablePage/tablePage.tsx';

const App = () => {
  return (
    <BrowserRouter>
    <div className='app'>
      <Nav />
        <Routes>
          <Route path="/plan" element={<PlanPage header="Plan"/>}/>
          <Route path="/table" element={<TablePage header=""/>}/>
        </Routes>
    </div>
    </BrowserRouter>
  )
}    

export default App
